                </div>
            </li>
            <li className="nav-item">
                <div style={{cursor: 'pointer', borderRadius: '5px'}} className="navigation nav-link p-1 mt-2"
                onClick={handleClickM(sort_by)}
                >
                    Next Page
                </div>
            </li>
        </ul>
    )
}

export default MovieTabs;
